DECLARE @Delete TABLE (BF_SSN CHAR(9), LN_SEQ INT, LN_RPS_SEQ INT, LD_CRT_LON65 DATETIME)

DECLARE @Update TABLE (BF_SSN CHAR(9), LN_SEQ INT, LN_RPS_SEQ INT, LD_CRT_LON65 DATETIME)

SELECT LN66.* FROM UDW..LN66_LON_RPS_SPF LN66 INNER JOIN @Delete D ON D.BF_SSN = LN66.BF_SSN AND D.LN_SEQ = LN66.LN_SEQ AND D.LN_RPS_SEQ = LN66.LN_RPS_SEQ
SELECT LN66.* FROM UDW..LN66_LON_RPS_SPF LN66 INNER JOIN @Update U ON U.BF_SSN = LN66.BF_SSN AND U.LN_SEQ = LN66.LN_SEQ AND U.LN_RPS_SEQ = LN66.LN_RPS_SEQ
--RS05
SELECT DISTINCT RS05.* FROM UDW..RS05_IBR_RPS RS05 INNER JOIN @Delete D ON D.BF_SSN = RS05.BF_SSN AND CAST(D.LD_CRT_LON65 AS DATE) = CAST(RS05.BD_CRT_RS05 AS DATE)
SELECT DISTINCT RS05.* FROM UDW..RS05_IBR_RPS RS05 INNER JOIN @Update U ON U.BF_SSN = RS05.BF_SSN AND CAST(U.LD_CRT_LON65 AS DATE) = CAST(RS05.BD_CRT_RS05 AS DATE)
--RS10
SELECT DISTINCT RS10.* FROM UDW..RS10_BR_RPD RS10 INNER JOIN @Delete D ON D.BF_SSN = RS10.BF_SSN AND D.LN_RPS_SEQ = RS10.LN_RPS_SEQ
SELECT DISTINCT RS10.* FROM UDW..RS10_BR_RPD RS10 INNER JOIN @Update U ON U.BF_SSN = RS10.BF_SSN AND U.LN_RPS_SEQ = RS10.LN_RPS_SEQ
--RS15
SELECT DISTINCT RS15.* FROM OPENQUERY(DUSTER, 'SELECT * FROM olwhrm1.RS15_IBR_EXT_LON') RS15 INNER JOIN @Delete D ON D.BF_SSN = RS15.BF_SSN AND CAST(D.LD_CRT_LON65 AS DATE) = CAST(RS15.BD_CRT_RS05 AS DATE)
SELECT DISTINCT RS15.* FROM OPENQUERY(DUSTER, 'SELECT * FROM olwhrm1.RS15_IBR_EXT_LON') RS15 INNER JOIN @Update U ON U.BF_SSN = RS15.BF_SSN AND CAST(U.LD_CRT_LON65 AS DATE) = CAST(RS15.BD_CRT_RS05 AS DATE)
--RS20
SELECT DISTINCT RS20.* FROM OPENQUERY(DUSTER, 'SELECT * FROM olwhrm1.RS20_IBR_IRL_LON') RS20 INNER JOIN @Delete D ON D.BF_SSN = RS20.BF_SSN AND CAST(D.LD_CRT_LON65 AS DATE) = CAST(RS20.BD_CRT_RS05 AS DATE) AND D.LN_SEQ = RS20.LN_SEQ
SELECT DISTINCT RS20.* FROM OPENQUERY(DUSTER, 'SELECT * FROM olwhrm1.RS20_IBR_IRL_LON') RS20 INNER JOIN @Update U ON U.BF_SSN = RS20.BF_SSN AND CAST(U.LD_CRT_LON65 AS DATE) = CAST(RS20.BD_CRT_RS05 AS DATE) AND U.LN_SEQ = RS20.LN_SEQ


